const express = require('express');
const bodyParser = require('body-parser');
const fs = require('fs');
const app = express();
const util = require('util');
const port = process.argv.length < 3?3000:process.argv[2];

const files = [];
files["favicon.ico"] = "";
files["index.html"] = "";
files["intro.html"] = "";
files["listImg.html"] = "";
files["listRepos.html"] = "";
files["listPs.html"] = "";
files["acercade.html"] = "";
files["main.js"] = "";
